    TransactionService.prototype.addRow = function () {
        var _this = this;
        try {
            if (this.TrnMainObj.ProdList == null) {
                this.TrnMainObj.ProdList = [];
            }
            //Duplicate Item with same batch check
            // let duplicatecheck = 0;
            // if (this.TrnMainObj.ProdList == null) {
            //   this.TrnMainObj.ProdList = [];
            // }
            // this.TrnMainObj.ProdList.reduce((aac, obj) => {
            //   var existitem = aac.find(
            //     item => item.MCODE === obj.MCODE && item.BATCH === obj.BATCH
            //   );
            //   if (existitem && this.TrnMainObj.VoucherType != VoucherTypeEnum.SalesOrder) {
            //     alert("Duplicate Item with same batch detected...");
            //     duplicatecheck = 1;
            //     return;
            //   }
            //   aac.push(obj);
            //   return aac;
            // }, []);
            // if (duplicatecheck == 1) {
            //   return false;
            // }
            if (this.TrnMainObj.VoucherType == __WEBPACK_IMPORTED_MODULE_2__interfaces_TrnMain__["a" /* VoucherTypeEnum */].Purchase ||
                this.TrnMainObj.VoucherType == __WEBPACK_IMPORTED_MODULE_2__interfaces_TrnMain__["a" /* VoucherTypeEnum */].OpeningStockBalance ||
                this.TrnMainObj.VoucherType == __WEBPACK_IMPORTED_MODULE_2__interfaces_TrnMain__["a" /* VoucherTypeEnum */].TaxInvoice) {
                if (this.TrnMainObj.ProdList.some(function (x) { return x.EXPDATE == null && x.MCODE != null; })) {
                    this.alertService.warning("Expiry Date of Item Not Detected..Please Review the list...");
                    return false;
                }
                var expitem = this.TrnMainObj.ProdList.filter(function (x) { return new Date(x.EXPDATE) < new Date(new Date().setDate(new Date().getDate() - 1)) && x.MCODE != null; })[0];
                if (expitem != null) {
                    this.alertService.warning("Expired Item Detected with code : " + expitem.MCODE + "..Please Review the list...");
                    return false;
                }
                if (this.TrnMainObj.ProdList.some(function (x) { return new Date(x.MFGDATE) > new Date() && x.MCODE != null; })) {
                    this.alertService.warning("Invalid Manufacture Date Item Detected..Please Review the list...");
                    return false;
                }
                if (this.TrnMainObj.ProdList.some(function (x) { return x.MCODE != null && _this.nullToZeroConverter(x.Quantity) < 1; })) {
                    this.alertService.warning("Invalid Entry With Invalid Quantity Detected.Please Check the Item Entry. ");
                    return false;
                }
            }
            // this.TrnMainObj.ProdList.forEach(x => x.inputMode = false);
            var newRow = {};
            newRow.inputMode = true;
            newRow.MENUCODE = null;
            newRow.ITEMDESC = null;
            newRow.RATE = null;
            newRow.RATE = null;
            newRow.NCRATE = null;
            newRow.AMOUNT = null;
            newRow.DISCOUNT = null;
            newRow.VAT = null;
            newRow.NETAMOUNT = null;
            newRow.ITEMTYPE = null;
            newRow.RECEIVEDTYPE = null;
            newRow.WAREHOUSE = null;
            newRow.BC = null;
            this.TrnMainObj.ProdList.push(newRow);
            return true;
        }
        catch (ex) {
            //this.alertService.error(ex);
            return false;
        }
    };
