                                _this._transactionService.TrnMainObj.TrntranList[_this.selectedIndex].ChequeNo = ac.BANKACCOUNTNUMBER;
                                var abc = data.result5.filter(function (x) { return x.BANKCODE == ac.BANKCODE && x.BANKACCOUNTNUMBER == ac.BANKACCOUNTNUMBER; });
                                if (abc.length && abc.length > 0) {
                                }
