                                _this._transactionService.TrnMainObj.TrntranList[_this.selectedIndex].BANKNAME = ac.BANKNAME;
                                _this._transactionService.TrnMainObj.TrntranList[_this.selectedIndex].BANKCODE = ac.BANKCODE;
                                _this._transactionService.TrnMainObj.TrntranList[_this.selectedIndex].ChequeNo = ac.BANKACCOUNTNUMBER;
                                _this._transactionService.TrnMainObj.TrntranList[_this.selectedIndex].hasAdditionalBank = false;
