    TrnTranVoucherEntryComponent.prototype.onChequeDateEnter = function ($event, index) {
        var _this = this;
        var nextindex = index + 1;
        if (this._transactionService.TrnMainObj.VoucherType == __WEBPACK_IMPORTED_MODULE_3__interfaces_TrnMain__["a" /* VoucherTypeEnum */].PostDirectory) {
            if (this._transactionService.TrnMainObj.Mode == "NEW") {
                this.validateCheque(this._transactionService.TrnMainObj.TrntranList[index].ChequeNo);
            }
            if (this._transactionService.validatedCheque == true) {
                return;
            }
            var ledgerWithSameChequeNumber = this._transactionService.TrnMainObj.TrntranList.filter(function (x, i) { return i != 0 && x.ChequeNo == _this._transactionService.TrnMainObj.TrntranList[index].ChequeNo; });
            if (ledgerWithSameChequeNumber.length > 0) {
                ledgerWithSameChequeNumber.forEach(function (x) {
                    x.ChequeDate = _this._transactionService.TrnMainObj.TrntranList[0].ChequeDate;
                    x.ChequeDateBS = _this._transactionService.TrnMainObj.TrntranList[0].ChequeDateBS;
                    x.BANKNAME = _this._transactionService.TrnMainObj.TrntranList[0].BANKNAME;
                    x.inputMode = false;
                });
                if (index > 0)
                    this.alertService.info("Cheque Date must be same if cheque number is same.");
            }
        }
        this._transactionService.addRowForTransaction(index);
        if (document.getElementById("ACCODEInput_" + nextindex) != null) {
            document.getElementById("ACCODEInput_" + nextindex).focus();
        }
        ;
    };
