    ProductInsertComponent.prototype.assignedSchemeToBatch = function () {
        var scheme = this._trnMainService.TrnMainObj.ProdList[this.activerowIndex]
            .ALLSCHEME;
        if (scheme != null) {
            if (scheme.batches == null || scheme.batches == "") {
                this.batchlist.forEach(function (b) {
                    b.SCHEME = scheme;
                    b.SCHEMERATE = scheme.schemeDisRate;
                    b.SCHEMENAME = scheme.schemeName;
                    b.SchemeRateType = scheme.discountRateType;
                });
            }
            else {
                var batches = scheme.batches.toString().split(",");
                this.batchlist.forEach(function (b) {
                    if (batches.find(function (x) { return x == b.BATCH; }) != null) {
                        b.SCHEME = scheme;
                        b.SCHEMERATE = scheme.schemeDisRate;
                        b.SCHEMENAME = scheme.schemeName;
                        b.SchemeRateType = scheme.discountRateType;
                    }
                });
            }
        }
    };
