    AccountMasterActionComponent.prototype.VerifySingleOrBulk = function () {
        var _this = this;
        var FilterValue = this._trnMainService.TrnMainObj.TrntranList.filter(function (x) { return x.acitem; });
        // //console.log("CheckData#",FilterValue, this._trnMainService.TrnMainObj)
        var count = 0;
        var dataList = [];
        FilterValue.forEach(function (x) {
            if (x.NARATION1 == "e-transfer") {
                count += 1;
            }
        });
        FilterValue.forEach(function (x) {
            // //console.log("count",count,x)
            if (count == 1) {
                if (x.NARATION1 == "e-transfer") {
                    var passObj = {};
                    passObj.description = x.acitem.ACNAME;
                    passObj.amount = _this._trnMainService.TrnMainObj.VoucherPrefix == "RV" ? x.CRAMNT : x.DRAMNT;
                    passObj.invoice_number = _this._trnMainService.TrnMainObj.VCHRNO;
                    // return;
                    _this.ClickCellPay(passObj);
                    // //console.log("CheckValue",passObj)
                }
                else {
                    _this.alertService.warning("Cannot do payment via CellPay");
                }
            }
            else if (count > 1) {
                if (x.NARATION1 == "e-transfer") {
                    var dataObj = {};
                    dataObj.id = 1;
                    dataObj.merchantName = x.acitem.ACNAME;
                    dataObj.merchantAccount = _this._trnMainService.TrnMainObj.TRNACName;
                    dataObj.bankCode = "SIDH";
                    dataObj.amount = _this._trnMainService.TrnMainObj.VoucherPrefix == "RV" ? x.CRAMNT : x.DRAMNT;
                    dataObj.description = x.NARATION;
                    dataObj.invoiceNumber = x.ChequeNo;
                    dataObj.paymentStatus = "False";
                    dataList.push(dataObj);
                }
            }
            else {
                _this.alertService.warning("Cannot do payment via CellPay");
            }
        });
        if (count > 1) {
            var passObj = {};
            passObj.merchant_code = "IMS";
            passObj.secret_key = "123123123";
            passObj.voucher_id = this._trnMainService.TrnMainObj.VCHRNO;
            passObj.invoice_number = this._trnMainService.TrnMainObj.VCHRNO;
            passObj.is_live = "false";
            this.BulkCellPay(passObj, dataList);
        }
    };
