    TrnMainVoucherEntryComponent.prototype.getAccountList = function (voucherType) {
        var _this = this;
        try {
            if (voucherType == "Party Payment") {
                this.masterService
                    .getAccount("IncomeVoucher-account")
                    .map(function (data) {
                    var fil = data.filter(function (ac) { return ac.PType == "V" || ac.PType == "C" || ac.PType == "CC"; });
                    return fil;
                })
                    .subscribe(function (res) {
                    _this._transactionService.accountListSubject.next(res);
                });
            }
            else if (voucherType == "Expenses Voucher") {
                this.masterService
                    .getAccount("IncomeVoucher-Expenses")
                    .map(function (data) {
                    var fil = data.filter(function (ac) { return ac.PType != "C" && ac.PType != "V" && ac.PType != "CC"; });
                    return fil;
                })
                    .subscribe(function (res) {
                    _this._transactionService.accountListSubject.next(res);
                });
            }
            else if (voucherType == "Party Receipt") {
                this.masterService
                    .getAccount("IncomeVoucher-account")
                    .map(function (data) {
                    var fil = data.filter(function (ac) { return ac.PType == "V" || ac.PType == "CV" || ac.PType == "C"; });
                    return fil;
                })
                    .subscribe(function (res) {
                    _this._transactionService.accountListSubject.next(res);
                });
            }
            else if (voucherType == "Income Voucher") {
                this.masterService
                    .getAccount("IncomeVoucher-Expenses")
                    .map(function (data) {
                    var fil = data.filter(function (ac) { return ac.PType != "C" && ac.PType != "V" && ac.PType != "CC"; });
                    return fil;
                })
                    .subscribe(function (res) {
                    _this._transactionService.accountListSubject.next(res);
                });
            }
            else {
                this.masterService
                    .getAccount("IncomeVoucher-default")
                    .subscribe(function (res) {
                    _this._transactionService.accountListSubject.next(res);
                });
            }
        }
        catch (ex) {
            alert(ex);
        }
    };
