    TrnTranNoteEntryComponent.prototype.showSubLedgerEntry = function (index) {
        try {
            if (this._transactionService.TrnMainObj.TrntranList[index]
                .SubledgerTranList == null) {
                this._transactionService.TrnMainObj.TrntranList[index].SubledgerTranList = [];
            }
            if (this._transactionService.TrnMainObj.TrntranList[index].SubledgerTranList
                .length == 0) {
                this.AddNewSubLedgerRow();
                this._transactionService.TrnMainObj.TrntranList[index].SubledgerTranList = this.subledgers;
            }
            this.subledgers = this._transactionService.TrnMainObj.TrntranList[index].SubledgerTranList;
            for (var i in this.subledgers) {
                if (this.subledgers[i].SubledgerItem != null &&
                    this.subledgers[i].SubledgerItem.ACNAME != null &&
                    this.subledgers[i].Amount != null &&
                    this.subledgers[i].Amount > 0) {
                    this.subledgers[i].ROWMODE = "save";
                }
            }
            this.hideSubledger = false;
            this.hideSubledgerList = true;
            this.showHelp = false;
        }
        catch (ex) {
            alert(ex);
        }
    };
